import itertools

from utils.all import xor

id_rsa = bytes.fromhex(
    ""
)
resource_zip = bytes.fromhex(
    ""
)
ecorp_png = bytes.fromhex(open("ecorp.png.enc", "r").read())
welcome_pdf = bytes.fromhex(open("welcome.pdf.enc", "r").read())

key = xor(b"-----BEGIN OPENSSH PRIVATE KEY-----", id_rsa)[:32]

open("resources.zip", "wb").write(xor(itertools.cycle(key), resource_zip))
open("ecorp.png", "wb").write(xor(itertools.cycle(key), ecorp_png))
open("welcome.pdf", "wb").write(xor(itertools.cycle(key), welcome_pdf))
